/**
 * @param {string} s
 * @param {number} k
 * @return {number}
 */
var beautifulSubstrings = function(s, k) {
    let count = 0;
    const vowels = new Set(['a', 'e', 'i', 'o', 'u']);
    const prefixSum = [[0, 0]]; // [vowels, consonants]

    for (let i = 0; i < s.length; i++) {
        const last = prefixSum[prefixSum.length - 1].slice();
        if (vowels.has(s[i])) {
            last[0] += 1;
        } else {
            last[1] += 1;
        }
        prefixSum.push(last);
    }

    for (let start = 0; start < s.length; start++) {
        for (let end = start + 1; end <= s.length; end++) {
            const [vowelsCount, consonantsCount] = [prefixSum[end][0] - prefixSum[start][0], prefixSum[end][1] - prefixSum[start][1]];
            if (vowelsCount === consonantsCount && (vowelsCount * consonantsCount) % k === 0) {
                count++;
            }
        }
    }

    return count;
};
